import styled from "styled-components";

//////////////////////////////////////
/*WebRTCRoom*/
//////////////////////////////////////
const MainView = styled.div`
  transition: margin-left 0.5s;
  width: 0;
`;
const SideBar = styled.div`
  height: calc(100% - 48px);
  width: 0;
  position: fixed;
  z-index: 0;
  top: 56px;
  right: 0;
  background-color: #2e373e;
  overflow-x: hidden;
  transition: 0.5s;
`;
const VideoBaseContainer = styled.div`
  width: 100vw;
  display: flex;
  background: #424c53;
`;

const SecondBox = styled.div`
  width: calc(100vw - 64px);
  height: calc(100vh - 56px);
  background: #424c53;
`;
const ToggleBtn = styled.div`
  display: flex;
  justify-content: flex-end;
  align-items: center;
  width: 19px;
  cursor: pointer;
`;

const Row = styled.div`
  display: flex;
  width: calc(100vw - 64px);
`;
const ToggleDiv = styled.div`
  width: calc((100vw - 64px) / 2);
  display: flex;
  justify-content: flex-end;
  padding-right: 25px;
`;

//////////////////////////////////////
/*VideoNav*/
const UpperNav = styled.div`
  width: calc((100vw - 64px) / 2);
  height: 56px;
  background: none;
  display: flex;
  flex-direction: row;
  align-items: center;
`;

const ConferenceTitle = styled.div`
  margin-left: 26px;
  font-size: 22px;
  color: white;
  font-family: NanumSquareB;
  overflow: hidden;
`;
const UserCount = styled.div`
  margin-left: 20px;
`;

const RoundDiv = styled.button`
  background: #2e373e;
  height: 28px;
  border: 1px solid #2e373e;
  border-radius: 13.5px;
  box-shadow: 1.9px 2.3px 7px black 0.2;

  font-size: 16px;
  display: flex;
  justify-content: center;
  align-items: center;

  cursor: pointer;
  outline: none;
`;

const TimeDiv = styled.button`
  background: #2e373e;
  height: 28px;
  border: 1px solid #2e373e;
  border-radius: 13.5px;
  box-shadow: 1.9px 2.3px 7px black 0.2;

  font-size: 16px;

  display: flex;
  justify-content: center;
  align-items: center;

  cursor: pointer;
  outline: none;
  width: auto;
  color: var(--greenish-teal);
  margin-left: 15px;
  font-size: 16.5px;
  padding-left: 15px;
  padding-right: 15px;

  &:hover {
    background: #f25959;
    color: white;
  }
